import logo from './logo.svg';
import './App.css';
import React, { useState } from "react";
import Home from './Pages/Home.js'

function App() {

  const [currentScreen, setCurrentScreen] = useState(1);
  const [wheelMotion, setWheel] = useState(0);


  function handleScroll(event) {
    console.log("mee", currentScreen)

    if (event.deltaY > 0) {
      setCurrentScreen(prevScreen => prevScreen + 1);
      setWheel(0);
    } else {
      setCurrentScreen(prevScreen => prevScreen - 1);
      setWheel(1);
    }
  }


  return (
      <Router>
        <Navbar/>
        <Routes>
          <Route path="/" element={<Index/>}>

          </Route>
          <Route path="/login" element={<Login/>}>

          </Route>
          <Route path="/playlists" element={<CreatePlaylist/>}>

          </Route>
          <Route path="/trending" element={<Trending/>}>

          </Route>
          <Route path="/trending/artists" element={<Trendingartists/>}>

          </Route>
          <Route path="/trending/albums" element={<Trendingalbums/>}>

          </Route>
          <Route path="/album" element={<Album/>}>

          </Route>
          <Route path="/search" element={<Search/>}>

          </Route>
          <Route path="/artistas" element={<Artistas/>}/>

        </Routes>
      </Router>

  );
}

export default App;
